package cn.com.evo.integration.wasu.common.content;import java.util.List;/** * @Description: * @author: lu.xin * @create: 2019-04-25 11:06 AM **/public class WasuContentData {    private List<WasuContent> contents;    private String folderCode;    private Integer pageIndex;    private Integer totalItems;    private Integer totalPages;    public List<WasuContent> getContents() {        return contents;    }    public void setContents(List<WasuContent> contents) {        this.contents = contents;    }    public Integer getPageIndex() {        return pageIndex;    }    public void setPageIndex(Integer pageIndex) {        this.pageIndex = pageIndex;    }    public Integer getTotalItems() {        return totalItems;    }    public void setTotalItems(Integer totalItems) {        this.totalItems = totalItems;    }    public Integer getTotalPages() {        return totalPages;    }    public void setTotalPages(Integer totalPages) {        this.totalPages = totalPages;    }    public String getFolderCode() {        return folderCode;    }    public void setFolderCode(String folderCode) {        this.folderCode = folderCode;    }}